import React, { useState, useEffect } from 'react';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { getPlaces } from '../API/placesaction';
import '../styles/Navbars.css';

function Navbars() {
  const [places, setPlaces] = useState([]);
  const [filteredPlaces, setFilteredPlaces] = useState([]);
  const [error, setError] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');

  const navigate = use
  useEffect(() => {
    getPlaces()
      .then(data => {
        setPlaces(data);
        setFilteredPlaces(data);
      })
      .catch(err => setError(err));
  }, []);

  const handleSearch = e => {
    const term = e.target.value;
   
    console.log(term);
    setSearchTerm(term);
    const filtered = places.filter(place =>
      place.name.toLowerCase().includes(term.toLowerCase())
    );
    
    setFilteredPlaces(filtered);
    console.log(filtered);
    navigate(`/login`)
  };
  

  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container fluid>
        <Navbar.Brand href="#">BOOK ANYWHERE</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav className="me-auto my-2 my-lg-0" style={{ maxHeight: '100px' }} navbarScroll>
            <Nav.Link href="#action1">Home</Nav.Link>
          </Nav>
          <Form className="d-flex" onSubmit={handleSearch}>
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
              value={searchTerm}
              onChange={(e)=> {setFilteredPlaces(e.target.value)}}
            />
            <Button variant="outline-success" >Search</Button>
          </Form>
          {/* {searchTerm && (
            <div className="search-suggestions">
              {filteredPlaces.map(place => (
                <p key={place.id}>{place.name}</p>
              ))}
            </div>
          )} */}
          <Nav>
            <Nav.Link href={`/login`}>Login</Nav.Link>
            <Nav.Link href={`/signup`}>Signup</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Navbars;
